import React from 'react';
import "../../../src/index.css"
import 'ldrs/helix';

const loading = () => {
   return (
     <div className="Loader-container"> 
    <l-helix
     size="123"
     speed="4"
     color="green">
    </l-helix>   
    </div>
   )
}

export default loading;
